          <Typography  variant="h5" component="h2" className={classes.name}>
            {item.name}  
          </Typography>

          <Typography  variant="h5" component="h2"className={classes.price} >
            ${item.price}
          </Typography>

        </CardContent>

        
        
        
      

      {/* <CardActions disableSpacing className={classes.cardActions}>
        
      </CardActions> */}
    </Card>
    );
}

export default Tea

